import React from 'react'
import VideoCard from './VideoCard'

const Videos = ({videos}) => {
  return (
    <div style={{direction:'row', flexWrap:'wrap', justifyContent:'start', gap:2}}>
      {videos.map((item, idx) => (
        <div key={idx}>
          {item.id.videoId && <VideoCard video={item}/>}
        </div>
      ))};
    </div>
  )
}

export default Videos
